export interface UpgradeRemediation {
    upgradeFrom: string;
    upgradeTo: string;
    vulns: Vuln[];
    severityScore: number;
    isTransitive?: boolean;
}
export interface PatchRemediation {
    paths: object[];
    issueData: Vuln;
    name: string;
    version: string;
    severityScore: number;
}
export interface Vuln {
    id: string;
    title: string;
    severity: string;
}
